import { Routes, Route } from "react-router-dom";
import Productos from './componentes/Productos.jsx';
import Testimonio from '../Testimonio.js';
import Navegacion from './componentes/Navegacion.jsx';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="sobre-productos" element={ <Productos 
          imagen = "1"
          nombre = "Xim Juan"
          descripcion = "Corea del sur"/> } />
        <Route path="sobre-testimonios" element={ 
          <Testimonio
          imagen = "1"
          nombre = "Xim Juan"
          pais = "Corea del sur"
          cargo = "Ingeniera de Software"
          empresa = "Sistemas Enlinea"
          testimonio = "lorem"
        />
        } />
      </Routes>
      <Navegacion/>
    </div>
  );
}

export default App;
